  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lost Trail
  National Wildlife Refuge outlines Refuge accomplishments during the 2000 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, public participation, and compliance with environmental and cultural
  resource mandates. Refuge administration is outlined; information about personnel,
  youth programs, manpower programs, volunteer programs, funding, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, forests,
  grasslands, haying, pest control, and water rights. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  and animal control. The public uses of the Refuge described in this report include
  outdoor classrooms, hunting, fishing, trapping, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about major
  maintenance and equipment replacement. Cooperative programs and items of interest
  are provided at the end. Refuge brochures are attached\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
